import React, {Component} from 'react';
import {Route} from 'react-router-dom';
import Title from './Title';
import Photowall from './Photowall';
import AddPhoto from './AddPhoto';
import './stylesheets/styles.css';

class Main extends Component {

    constructor () {
      super()
      this.state = {
        photos: [ ], 
        screen: 'photos'
      };
      this.removePhoto = this.removePhoto.bind(this);
      this.navigate = this.navigate.bind(this);
      this.addPhoto = this.addPhoto.bind(this);
    }

    removePhoto(photoRemoved) {
      console.log(photoRemoved.description);
      this.setState(() => ({
        photos: this.state.photos.filter(photo => photo !== photoRemoved)
      }))
    }

    navigate() {
      this.setState({
        screen: 'addPhotos'
      })
    }

    componentDidMount() {
      const data = this.simulateFetchFromDataBase();
      this.setState({
        photos: data
      })
    }

    addPhoto(photoSubmitted) {
      this.setState({
        photos: this.state.photos.concat([photoSubmitted])
      })
    }

    render () {
      return <div> 
        <Route exact path='/' render={() => (
          <div> 
            <Title title='Photowall'/>
            <Photowall posts={this.state.photos} onRemovePhoto={this.removePhoto} onNavigate={this.navigate} />
          </div>
          )}> 
        </Route>
          
        <Route path='/AddPhoto' render={({history}) => (
            <AddPhoto onAddNewPhoto={(newPhoto) => {
              this.addPhoto(newPhoto);
              history.push('/');
            }}/>
          )}> 
        </Route>        
      </div>
    }

    simulateFetchFromDataBase() {
      return [
        {
          id: 0,
          description: 'Calm sea on a clear day',
          url: 'https://previews.123rf.com/images/galiyahassan/galiyahassan1704/galiyahassan170400234/77313322-beautiful-view-of-blue-water-and-clean-sky-through-green-trees-at-sunny-summer-day-.jpg'
        }, 
        {
            id: 1,
            description: 'Beautiful night with stars',
            url: 'data:image/jpeg;base64,'
        }, 
        {
            id: 2,
            description: 'Refreshing rains',
            url: 'https://en.neonetwork.pk/digital_images/large/2017-07-13/heavy-monsoon-rain-with-thunderstorm-expected-in-parts-of-country-1499922009-1471.jpg'
        },
        {
          id: 3,
          description: 'Raising sun',
          url: 'data:image/jpeg;base64,'
        }
      ];
    }
  }

  export default Main